import { combineReducers } from "redux"
import {
    getLiveAuctionListReducer,
    getSoldAuctionListReducer,
    getExpiredAuctionListReducer,
    getLotsListReducer,
    getLiveAuctionListAction, getSoldAuctionListAction, getExpiredAuctionListAction
} from './AuctopnReducer'

export const MainReducer = combineReducers({
    getLiveAuctionListAction, getSoldAuctionListAction,
    getExpiredAuctionListAction,
})
